import React from "react";
import theme from "./theme";
import "./App.css";
import { ThemeProvider } from "theme-ui";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div
        css={{
          fontFamily: 'body',
          color: 'text',
          bg: 'background',
        }}
      >
        <Styled.h1>Theme UI + Create React App</Styled.h1>
      </div>
    </ThemeProvider>
  )
}

export default App;
